    return <h2>(status === "PENDING")? "Your application is pending approval.": "There was an error processing your request."</h2>;
  }
}

let mapStateToProps = (state) => {
  return{
    status: state.tempEdge.login.portalUserList[0].status
  };
}

export default withLocalize(connect(mapStateToProps)(Error));
